import styled from "styled-components";

export const BrandStoryBannerWrapper = styled.div`
  background-color: #0565bb;
  width: 100%;
  height: 956px;
  position: relative;
`;
export const Header = styled.div`
  position: absolute;
  top: 100px;
  left: 50%;
  transform: translate(-50%, -50%);
  text-transform: uppercase;
  font-family: Montserrat;
  font-size: 45px;
  font-weight: bold;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.33;
  letter-spacing: 4.5px;
  text-align: left;
  color: #fcd32a;
`;

export const Content = styled.div`
  top: 150px;
  left: 50%;
  transform: translate(-50%, -50%);
  margin-top: 30px;
  position: absolute;
  font-family: NotoSansCJKkr;
  font-size: 16px;
  font-weight: 300;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.88;
  letter-spacing: normal;
  text-align: center;
  color: #fcd32a;
`;
export const ImageWrapper = styled.div`
  width: 60%;
  height: 50%;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  position: absolute;
`;
export const ImageDiv = styled.div`
  width: 100%;
  height: 100%;
  position: relative;
  
`;
export const Box = styled.div`

  top: 10%;
  left: 50%;
    

  position: absolute;
  width: 40%;
  height: 40%;
`;

export const HeaderBrandStory= styled.div`
  font-family: Montserrat;
  font-size: 25px;
  font-weight: 800;
  font-stretch: normal;
  font-style: normal;
  line-height: 2.4;
  letter-spacing: normal;
  text-align: left;
  color: #222;
  

`;

export const ContentBrandStory= styled.div`

  font-family: NotoSansCJKkr;
  font-size: 16px;
  font-weight: 300;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.88;
  letter-spacing: normal;
  text-align: left;
  color: #222;


`;
export const Image = styled.img`
  width: 100%;
  height: 100%;
`;
export const Button = styled.button`
  width: 250px;
  text-transform: uppercase;
  margin: 47px 325px 0 4px;
  padding: 21px 37px;
  border: solid 3px #020001;
  background-color: #fff;
  font-family: Montserrat;
  font-size: 23px;
  font-weight: 900;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.09;
  letter-spacing: normal;
  
  color: #222;
`;
export const ImageObject = styled.img`
  width: 183px;
  height: 208px;
  margin: 122px 267px 24px 250px;
  object-fit: contain;
 
`; 
export const ImageObject1 = styled.img`
  width: 192px;
  height: 338px;
 
  bottom: 300px;
  left: 0;
  position: absolute;
 
`; 
export const ImageObject2 = styled.img`
  width: 192px;
  height: 255px;
  
  bottom:300px;
  left: 192px;
  position: absolute;
 
`; 
export const ImageObject3 = styled.img`
  width: 350px;
  height: 233px;
  right: 0;
 
  bottom:300px;
  z-index: 1;
  position: absolute;
 
`; 
export const ImageObject4 = styled.img`
  width: 197px;
  height: 457px;
  right: 0;
 
  bottom:400px;
 
  position: absolute;
 
`;
